window.bookSummaryJSON = "<p><b>Jack Frey was a street thief, saved from the gallows and forced to join a mysterious order of warrior priests known as the Black Dogs. </b></p> <p>Their mission is to keep the country of Abios safe from the flesh-eating demons known as the Nostros. But the Black Dogs have other enemies. Before Jack can take his vows and become a Black Dog, he's asked to help on a simple mission. He thinks it's an easy job, but he soon discovers the war is closer to home than he thought.</p>"; 
